import React from "react";

const logos = ["Aeris", "Bira", "Citymall", "Cleartax", "Hike", "Rapido", "Snapdeal", "Livspace", "Metro"];

const CorporateLogos = () => (
  <section className="full-viewport">
    <h2 className="section-title">Trusted by Corporate Partners</h2>
    <div className="focus-cards-grid">
      {logos.map((l, i) => (
        <div key={i} className="car-item" style={{ textAlign: "center" }}>
          <div className="brand" style={{ display: "inline-block" }}>{l}</div>
          <p className="price-hint"><small>Partner</small></p>
        </div>
      ))}
    </div>
  </section>
);

export default CorporateLogos;
